Diagnosis (instar II).
Larger species (HL more than 
1.05 mm
); head (
Fig. 27
) pyriform; nasale digitiform; half-circle of dense spinulae on lateroventral margins of nasale absent; hole-like structure on ventrodistal surface of nasale absent; lateral margins of nasale not inflated in dorsal view; lateral branches of nasale well developed; parietal numerous; seta AN2 present; distal half of MN broad; setae LA3, LA4, LA5 and LA8 robust; secondary setae on U present (
Fig. 30
).
